import React, { Component } from 'react';
import qAPI from './qAPI/qAPI';
import './App.css';

class App extends Component {
	constructor() {
		super();
		this.api = new qAPI();
		this.state = {
			question:null
		};
		this.api.getQuestion(0).then(res => this.setState({ question:res }));
	}

	componentDidMount() {}

	render() {

		let content="loading question";

		if(this.state.question){
			content=<h4>{this.state.question.q} ? unit:{this.state.question.unit}</h4>;
		}

		return (
			<React.Fragment>
				<h3>STATBOY</h3>
				{/* {Object.values(this.state.data).map(d=><h3 key={d.id}>{d.text}</h3>)} */}
				{content}
			</React.Fragment>
		);
	}
}

export default App;
